svg.script:
var svgDocument;
var zoomAmt;
var xOffset;
var yOffset;
var scale;
var maxScale;
var imageWidth;
var imageHeight;
function init(evt)
{
    svgDocument = evt.getTarget().getOwnerDocument();
    zoomAmt = 0;
    xOffset = 0;
    yOffset = 60;
    scale = 0.8;
    maxScale = 10;
    imageWidth = 742;
    imageHeight = 606;
    panRestore();
    //panUp();
}
function transformMap ()
{
    var obj = svgDocument.getElementById("Pathway");
    var centerX = imageWidth  / 2.0;
    var centerY = imageHeight / 2.0;
    var adjustX = (-centerX * (scale - 0.8)) + xOffset;
    var adjustY = (-centerY * (scale - 0.8)) + yOffset;
    var transParms = 'translate(' + adjustX + ',' + adjustY + ') ';
    transParms += 'scale(' + scale + ')';
    // alert(transParms);
    obj.setAttribute("transform", transParms); 
}
function click_node(id)
{
    var testx = parent.click_node;
    if (typeof(testx) == "function")
    {
		parent.click_node(id);
    }
}
function click_relation(id)
{
    var testx = parent.click_relation;
    if (typeof(testx) == "function")
    {
        parent.click_relation(id);
    }
}
function click_pathway(toId, fromId)
{
    var testx = parent.click_pathway;
    if (typeof(testx) == "function")
    {
	parent.click_pathway(toId, fromId);
    }
}
function check_interpath(evt, pathid)
{
  var obj = evt.getTarget();
  var testx = parent.is_frompath;
  var child = obj.firstChild;
  if (typeof(testx) == "function")
  {
    if (parent.is_frompath(pathid))
    {
      while (child != null)
      {
        if (child.nodeType == 1)
        {
          if ((child.localName == "g") || (child.localName == "polyline"))
          {
            child.setAttribute("style", "fill:none;stroke:red");
          }
          else if (child.localName == "polygon")
          {
            child.setAttribute("style", "fill:red;stroke:red");
          }
        }
        child = child.nextSibling;
      }
    }
  }
}
function set_status (msg)
{
 var obj = svgDocument.getElementById("status_text");
  var child;

  child = obj.firstChild;
  if ((child != null) && (child.nodeType == 3))
  {
    if ((msg != null) && (msg.length > 0))
    {
      child.data = msg;
    }
    else
    {
child.data = " ";
    }
  }
}
function zoomIn ()
{
    scale = scale + 0.8;
    if (scale > maxScale)
    {
       scale = maxScale;
    }
    transformMap();
    panUp();
    panUp();
    panUp();
    panUp();
    panUp();
    panUp();
    panUp();
    panUp();
    panUp();
    panUp();
    panUp();
    panUp();
}
function zoomOut ()
{
    scale = scale - 0.8;
    if (scale < 0.8)
    {
       scale = 0.8;
    }
    transformMap();
    panDown();
    panDown();
    panDown();
    panDown();
    panDown();
    panDown();
    panDown();
    panDown();
    panDown();
    panDown();
    panDown();
    panDown();
}
function panUp ()
{
    yOffset = yOffset + 20;
    transformMap();
}
function panDown ()
{
    yOffset = yOffset - 20;
    transformMap();
}
function panLeft ()
{
    xOffset = xOffset + 20;
    transformMap();
}
function panRight ()
{
    xOffset = xOffset - 20;
    transformMap();
}
function panRestore ()
{
    xOffset = 0;
    yOffset = 0;
    scale = 0.5;
    //obj = svgDocument.getElementById("zoom");
    //obj.setAttribute("x1", 0);
    //obj.setAttribute("x2", 0);
    transformMap();    
}
function doHighlight (evt, msg)
{
  var obj = evt.getTarget();
  obj.setAttribute("fill", "rgb(239,24,33)");
  set_status(msg);
}
function resetHighlight (evt)
{
  var obj = evt.getTarget();
  obj.setAttribute("fill", "rgb(99,154,206)");
  set_status(" ");
}
//
